/*Table structure for table `tbl_seller_product` */

DROP TABLE IF EXISTS `tbl_seller_product`;

CREATE TABLE `tbl_seller_product` (
  `sp_id` int(11) NOT NULL AUTO_INCREMENT,
  `created_date` datetime DEFAULT NULL,
  `updated_date` datetime DEFAULT NULL,
  `approved_date` datetime DEFAULT NULL,
  `seller_id` varchar(50) DEFAULT NULL,
  `product_id` int(11) DEFAULT NULL,
  `seller_product_description` text,
  `seller_sku` varchar(50) DEFAULT NULL,
  `condition_id` int(11) DEFAULT NULL,
  `is_featured` enum('0','1') DEFAULT '0',
  `is_banner` enum('0','1') DEFAULT '0',
  `product_meta` blob,
  `ranking` int(11) DEFAULT NULL,
  `shipping_ids` varchar(255) DEFAULT NULL,
  `shipping_info` int(11) DEFAULT NULL,
  `approve` enum('0','1') DEFAULT '0',
  `is_active` enum('0','1') DEFAULT '1',
  PRIMARY KEY (`sp_id`),
  KEY `FK_tbl_seller_product_variant` (`product_id`),
  KEY `FK_tbl_seller_product_variant2` (`seller_id`),
  KEY `FK_tbl_seller_product_variant5` (`condition_id`),
  KEY `FK_tbl_seller_product_shipping_info` (`shipping_info`),
  CONSTRAINT `FK_tbl_seller_product_shipping_info` FOREIGN KEY (`shipping_info`) REFERENCES `tbl_product_shipping_info` (`shipping_info_id`),
  CONSTRAINT `FK_tbl_seller_product_variant` FOREIGN KEY (`product_id`) REFERENCES `tbl_product` (`product_id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `FK_tbl_seller_product_variant5` FOREIGN KEY (`condition_id`) REFERENCES `tbl_product_conditions` (`condition_id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=latin1;

