/*Table structure for table `tbl_user_locations` */

DROP TABLE IF EXISTS `tbl_user_locations`;

CREATE TABLE `tbl_user_locations` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `created` datetime DEFAULT NULL,
  `updated` datetime DEFAULT NULL,
  `user_id` varchar(255) DEFAULT NULL,
  `user_type` varchar(255) DEFAULT NULL,
  `ship_fullname` varchar(255) DEFAULT NULL,
  `ship_contact` varchar(255) DEFAULT NULL,
  `ship_address_1` text,
  `ship_address_2` text,
  `ship_country` varchar(255) DEFAULT NULL,
  `ship_state` varchar(255) DEFAULT NULL,
  `ship_city` varchar(255) DEFAULT NULL,
  `ship_zip` varchar(255) DEFAULT NULL,
  `bill_fullname` varchar(255) DEFAULT NULL,
  `bill_contact` varchar(255) DEFAULT NULL,
  `bill_address_1` text,
  `bill_address_2` text,
  `bill_country` varchar(255) DEFAULT NULL,
  `bill_state` varchar(255) DEFAULT NULL,
  `bill_city` varchar(255) DEFAULT NULL,
  `bill_zip` varchar(255) DEFAULT NULL,
  `use_address` tinyint(1) DEFAULT '0',
  `display_status` enum('0','1') DEFAULT '0',
  `active` tinyint(4) DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=47 DEFAULT CHARSET=latin1;

